import React from 'react'
import { Form, ToggleButton, ToggleButtonGroup } from 'react-bootstrap';

export default function FederationForm({ federations }){

  const handleChange = (val) => setvalue(val)
  return (
    <div>
      <ToggleButtonGroup type="checkbox" value={[1,2]} onChange={handleChange}>
        {federations.map((federation, index) => {
          return (
            <ToggleButton id="tbg-btn-1" value={index + 1}>
              {federation}
            </ToggleButton>
            )
          })
        }
      </ToggleButtonGroup>
    </div>
  )
}
